%% üß† –õ–∞–±–æ—Ä–∞—Ç–æ—Ä–Ω–∞—è —Ä–∞–±–æ—Ç–∞: –û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è —ç—Ç–∞–ª–æ–Ω–Ω—ã—Ö —Ñ—É–Ω–∫—Ü–∏–π —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º –≥–µ–Ω–µ—Ç–∏—á–µ—Å–∫–æ–≥–æ –∞–ª–≥–æ—Ä–∏—Ç–º–∞
% –ê–≤—Ç–æ—Ä: Lieson
% –û–ø–∏—Å–∞–Ω–∏–µ: –≠—Ç–æ—Ç —Å–∫—Ä–∏–ø—Ç —Ä–µ–∞–ª–∏–∑—É–µ—Ç –∫–∞—Å—Ç–æ–º–Ω—ã–π –ì–ê –¥–ª—è –ø–æ–∏—Å–∫–∞ –º–∏–Ω–∏–º—É–º–æ–≤ —ç—Ç–∞–ª–æ–Ω–Ω—ã—Ö —Ñ—É–Ω–∫—Ü–∏–π –¥–ª—è n=2 –∏ n=3,
% –≤–∏–∑—É–∞–ª–∏–∑–∏—Ä—É–µ—Ç –ø—Ä–æ—Ü–µ—Å—Å –∏ –∞–Ω–∞–ª–∏–∑–∏—Ä—É–µ—Ç –∑–∞–≤–∏—Å–∏–º–æ—Å—Ç—å –æ—Ç –ø–∞—Ä–∞–º–µ—Ç—Ä–æ–≤.

clc; clear; close all; % –û—á–∏—Å—Ç–∫–∞ —Ä–∞–±–æ—á–µ–π –æ–±–ª–∞—Å—Ç–∏ –∏ –≥—Ä–∞—Ñ–∏–∫–æ–≤

%% ‚öôÔ∏è –ü–∞—Ä–∞–º–µ—Ç—Ä—ã –∫–æ–Ω—Ñ–∏–≥—É—Ä–∞—Ü–∏–∏
visualizationMode = 'full';  % 'full', '2donly', 'minimal', 'none'
visualizationUpdateRate = 3;  % –û–±–Ω–æ–≤–ª—è—Ç—å –≥—Ä–∞—Ñ–∏–∫–∏ –∫–∞–∂–¥—ã–µ N –ø–æ–∫–æ–ª–µ–Ω–∏–π
minDeltaTime = 0.1;           % –ú–∏–Ω–∏–º–∞–ª—å–Ω–æ–µ –≤—Ä–µ–º—è –º–µ–∂–¥—É –æ–±–Ω–æ–≤–ª–µ–Ω–∏—è–º–∏ (—Å–µ–∫—É–Ω–¥—ã)
pauseDuration = 0.05;         % –î–ª–∏—Ç–µ–ª—å–Ω–æ—Å—Ç—å –ø–∞—É–∑—ã –º–µ–∂–¥—É –æ–±–Ω–æ–≤–ª–µ–Ω–∏—è–º–∏

%% üî¢ 1. –û–ø—Ä–µ–¥–µ–ª–µ–Ω–∏–µ —ç—Ç–∞–ª–æ–Ω–Ω—ã—Ö —Ñ—É–Ω–∫—Ü–∏–π –∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–æ–≤

% –î–ª—è n=2: –§—É–Ω–∫—Ü–∏—è –ì–æ–ª—å–¥—à—Ç–µ–π–Ω-–ü—Ä–∞–π—Å
goldstein_price = @(x) (1 + (x(1) + x(2) + 1).^2 .* (19 - 14*x(1) + 3*x(1).^2 - 14*x(2) + 6*x(1)*x(2) + 3*x(2).^2)) .* ...
    (30 + (2*x(1) - 3*x(2)).^2 .* (18 - 32*x(1) + 12*x(1).^2 + 48*x(2) - 36*x(1)*x(2) + 27*x(2).^2));

% –ò–∑–≤–µ—Å—Ç–Ω—ã–π –≥–ª–æ–±–∞–ª—å–Ω—ã–π –º–∏–Ω–∏–º—É–º –¥–ª—è –ì–æ–ª—å–¥—à—Ç–µ–π–Ω-–ü—Ä–∞–π—Å
gp_global_min = [0, -1];
gp_global_val = 3;

% –î–ª—è n=3: –¢—Ä–µ—Ö–º–µ—Ä–Ω–∞—è —Ñ—É–Ω–∫—Ü–∏—è –†–∞—Å—Ç—Ä–∏–≥–∏–Ω–∞
rastrigin_3d = @(x) 10 * 3 + sum(x.^2 - 10 * cos(2 * pi * x));
rastrigin_global_min = [0, 0, 0];
rastrigin_global_val = 0;

fprintf('–û–ø—Ä–µ–¥–µ–ª–µ–Ω—ã —ç—Ç–∞–ª–æ–Ω–Ω—ã–µ —Ñ—É–Ω–∫—Ü–∏–∏:\n'); %[output:1c6d5b77]
fprintf('1. –ì–æ–ª—å–¥—à—Ç–µ–π–Ω-–ü—Ä–∞–π—Å (n=2). –ì–ª–æ–±–∞–ª—å–Ω—ã–π –º–∏–Ω–∏–º—É–º: f(%s) = %.4f\n', num2str(gp_global_min), gp_global_val); %[output:867ca0be]
fprintf('2. –†–∞—Å—Ç—Ä–∏–≥–∏–Ω (n=3). –ì–ª–æ–±–∞–ª—å–Ω—ã–π –º–∏–Ω–∏–º—É–º: f(%s) = %.4f\n\n', num2str(rastrigin_global_min), rastrigin_global_val); %[output:2f37b8b2]

%% üåÑ 2. –í–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏—è —Ñ—É–Ω–∫—Ü–∏–∏ –ì–æ–ª—å–¥—à—Ç–µ–π–Ω-–ü—Ä–∞–π—Å –¥–ª—è n=2
fprintf('–ì–µ–Ω–µ—Ä–∞—Ü–∏—è 3D –ø–æ–≤–µ—Ä—Ö–Ω–æ—Å—Ç–∏ –¥–ª—è —Ñ—É–Ω–∫—Ü–∏–∏ –ì–æ–ª—å–¥—à—Ç–µ–π–Ω-–ü—Ä–∞–π—Å (n=2)...\n'); %[output:7fb8e18c]

[x1, x2] = meshgrid(-2:0.05:2, -2:0.05:2);
f_values = arrayfun(@(a, b) goldstein_price([a, b]), x1, x2);

figSurface = figure('Name', '–ü–æ–≤–µ—Ä—Ö–Ω–æ—Å—Ç—å —Ñ—É–Ω–∫—Ü–∏–∏', 'Position', [100 100 800 600]); %[output:4b70059e]
surf(x1, x2, f_values, 'EdgeColor', 'none'); %[output:4b70059e]
colormap('jet'); colorbar; %[output:4b70059e]
xlabel('x_1'); ylabel('x_2'); zlabel('f(x_1, x_2)'); %[output:4b70059e]
title('üåÑ –ü–æ–≤–µ—Ä—Ö–Ω–æ—Å—Ç—å —Ñ—É–Ω–∫—Ü–∏–∏ –ì–æ–ª—å–¥—à—Ç–µ–π–Ω-–ü—Ä–∞–π—Å (n=2)'); %[output:4b70059e]
view(45, 30); grid on; hold on; %[output:4b70059e]
plot3(gp_global_min(1), gp_global_min(2), gp_global_val, 'rp', 'MarkerSize', 15, 'MarkerFaceColor', 'r'); %[output:4b70059e]
legend('–ü–æ–≤–µ—Ä—Ö–Ω–æ—Å—Ç—å', '–ì–ª–æ–±–∞–ª—å–Ω—ã–π –º–∏–Ω–∏–º—É–º', 'Location', 'best'); %[output:4b70059e]
hold off; %[output:4b70059e]

%% üß¨ 3.1 –†–µ–∞–ª–∏–∑–∞—Ü–∏—è –∫–∞—Å—Ç–æ–º–Ω–æ–≥–æ –ì–ê —Å –æ–ø—Ç–∏–º–∏–∑–∏—Ä–æ–≤–∞–Ω–Ω–æ–π –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–µ–π –¥–ª—è n=2
fprintf('–ù–∞—Å—Ç—Ä–æ–π–∫–∞ –∫–∞—Å—Ç–æ–º–Ω–æ–≥–æ –ì–ê –¥–ª—è n=2 —Å –æ–ø—Ç–∏–º–∏–∑–∏—Ä–æ–≤–∞–Ω–Ω–æ–π –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–µ–π...\n'); %[output:72c3fe2c]

% –ü–∞—Ä–∞–º–µ—Ç—Ä—ã –ì–ê –¥–ª—è n=2
nDim = 2;
lb = [-2, -2];
ub = [2, 2];
popSize = 50;
maxGen = 100;
maxStallGens = 15;
mutationRate = 0.1;
crossoverRate = 0.8;
eliteCount = 2;

% –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –ø–æ–ø—É–ª—è—Ü–∏–∏
population = rand(popSize, nDim) .* (ub - lb) + lb;

% –ü—Ä–µ–¥–≤–∞—Ä–∏—Ç–µ–ª—å–Ω–æ–µ –≤—ã–¥–µ–ª–µ–Ω–∏–µ –º–∞—Å—Å–∏–≤–æ–≤ –¥–ª—è –∏—Å—Ç–æ—Ä–∏–∏
bestFitnessHistory = zeros(maxGen, 1);
bestIndividualHistory = zeros(maxGen, nDim);
stallCounter = 0;
generationTimestamps = zeros(maxGen, 1);
lastUpdateTime = tic;

% –ù–∞—Å—Ç—Ä–æ–π–∫–∞ –≥—Ä–∞—Ñ–∏–∫–∞ –∫–æ–Ω—Ç—É—Ä–æ–≤ –¥–ª—è –∞–Ω–∏–º–∞—Ü–∏–∏
if ~strcmp(visualizationMode, 'none')
    figAnimation = figure('Name', '–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è –ì–ê 2D', 'Position', [100 100 900 700]); %[output:4fc9abc3]
    contour(x1, x2, log(f_values), 50); %[output:4fc9abc3]
    hold on; %[output:4fc9abc3]
    h_global = plot(gp_global_min(1), gp_global_min(2), 'rp', 'MarkerSize', 20, 'MarkerFaceColor', 'r'); %[output:4fc9abc3]
    h_pop = plot(population(:,1), population(:,2), 'ko', 'MarkerSize', 4, 'MarkerFaceColor', 'k'); %[output:4fc9abc3]
    h_best = plot(nan, nan, 'go', 'MarkerSize', 12, 'MarkerFaceColor', 'g'); %[output:4fc9abc3]
    
    % –î–æ–±–∞–≤–ª–µ–Ω–∏–µ –æ—Ç—Å–ª–µ–∂–∏–≤–∞–Ω–∏—è –ø—É—Ç–∏ –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏
    h_path = plot(nan, nan, 'b-', 'LineWidth', 1.5, 'Color', [0 0.4470 0.7410 0.3]); %[output:4fc9abc3]
    
    xlabel('x_1'); ylabel('x_2'); %[output:4fc9abc3]
    title('–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è –ì–ê 2D: –ü–æ–∫–æ–ª–µ–Ω–∏–µ 0'); %[output:4fc9abc3]
    legend([h_global, h_best, h_pop, h_path], '–ì–ª–æ–±–∞–ª—å–Ω—ã–π –º–∏–Ω.', '–õ—É—á—à–∏–π –ì–ê', '–ü–æ–ø—É–ª—è—Ü–∏—è', '–ü—É—Ç—å –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏', 'Location', 'best'); %[output:4fc9abc3]
    colorbar; %[output:4fc9abc3]
    hold off; %[output:4fc9abc3]
    
    % –ù–∞—Å—Ç—Ä–æ–π–∫–∞ 3D –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–∏ –ì–ê –µ—Å–ª–∏ –≤–∫–ª—é—á–µ–Ω–∞
    if strcmp(visualizationMode, 'full')
        fig3D = figure('Name', '–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è –ì–ê 3D', 'Position', [300 100 900 700]); %[output:0d3c0f47]
        surfHandle = surf(x1, x2, f_values, 'EdgeColor', 'none', 'FaceAlpha', 0.4); %[output:0d3c0f47]
        colormap('jet'); colorbar; hold on; %[output:0d3c0f47]
        h_global3D = plot3(gp_global_min(1), gp_global_min(2), gp_global_val, 'rp', 'MarkerSize', 15, 'MarkerFaceColor', 'r'); %[output:0d3c0f47]
        
        % –ò—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ scatter3 –¥–ª—è –ª—É—á—à–µ–π –ø—Ä–æ–∏–∑–≤–æ–¥–∏—Ç–µ–ª—å–Ω–æ—Å—Ç–∏
        h_pop3D = scatter3(nan, nan, nan, 30, 'k', 'filled', 'MarkerFaceAlpha', 0.6); %[output:0d3c0f47]
        h_best3D = scatter3(nan, nan, nan, 100, 'g', 'filled'); %[output:0d3c0f47]
        
        % –î–æ–±–∞–≤–ª–µ–Ω–∏–µ 3D –ø—É—Ç–∏ –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏
        h_path3D = plot3(nan, nan, nan, 'b-', 'LineWidth', 2, 'Color', [0 0.4470 0.7410 0.4]); %[output:0d3c0f47]
        
        xlabel('x_1'); ylabel('x_2'); zlabel('f(x_1,x_2)'); %[output:0d3c0f47]
        title('–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è –ì–ê 3D: –ü–æ–∫–æ–ª–µ–Ω–∏–µ 0'); %[output:0d3c0f47]
        view(45, 30); grid on; %[output:0d3c0f47]
        legend([h_global3D, h_best3D, h_pop3D, h_path3D], '–ì–ª–æ–±–∞–ª—å–Ω—ã–π –º–∏–Ω.', '–õ—É—á—à–∏–π –ì–ê', '–ü–æ–ø—É–ª—è—Ü–∏—è', '–ü—É—Ç—å –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏', 'Location', 'best'); %[output:0d3c0f47]
        hold off; %[output:0d3c0f47]
    end
end

fprintf('–ó–∞–ø—É—Å–∫ –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏ –≤ —Ä–µ–∂–∏–º–µ –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–∏: %s...\n', visualizationMode); %[output:4efec87a]

% –ì–ª–∞–≤–Ω—ã–π —Ü–∏–∫–ª –ì–ê
for gen = 1:maxGen %[output:group:91ad727a]
    generationTimestamps(gen) = toc;
    
    % 1. –û—Ü–µ–Ω–∫–∞
    fitness = zeros(popSize, 1);
    for i = 1:popSize
        fitness(i) = goldstein_price(population(i, :));
    end
    
    % 2. –°–µ–ª–µ–∫—Ü–∏—è –∏ —ç–ª–∏—Ç–∏–∑–º
    [sortedFitness, sortIndex] = sort(fitness);
    population = population(sortIndex, :);
    
    bestFitnessHistory(gen) = sortedFitness(1);
    bestIndividualHistory(gen, :) = population(1, :);
    
    % 3. –ü—Ä–æ–≤–µ—Ä–∫–∞ –∫—Ä–∏—Ç–µ—Ä–∏—è –æ—Å—Ç–∞–Ω–æ–≤–∫–∏ (–ó–∞—Å—Ç—Ä—è–≤—à–∏–µ –ø–æ–∫–æ–ª–µ–Ω–∏—è)
    if gen > 1
        if abs(bestFitnessHistory(gen) - bestFitnessHistory(gen-1)) < 1e-6
            stallCounter = stallCounter + 1;
        else
            stallCounter = 0;
        end
    end
    if stallCounter >= maxStallGens
        fprintf('–û—Å—Ç–∞–Ω–æ–≤–∫–∞: –õ—É—á—à–∞—è –ø—Ä–∏—Å–ø–æ—Å–æ–±–ª–µ–Ω–Ω–æ—Å—Ç—å –Ω–µ —É–ª—É—á—à–∞–ª–∞—Å—å %d –ø–æ–∫–æ–ª–µ–Ω–∏–π.\n', maxStallGens); %[output:6e4cd7fc]
        break;
    end
    
    % 4. –°–æ–∑–¥–∞–Ω–∏–µ –Ω–æ–≤–æ–π –ø–æ–ø—É–ª—è—Ü–∏–∏
    newPopulation = population(1:eliteCount, :); % –≠–ª–∏—Ç–∏–∑–º
    for i = 1:(popSize - eliteCount)
        % –¢—É—Ä–Ω–∏—Ä–Ω–∞—è —Å–µ–ª–µ–∫—Ü–∏—è
        candidates = randperm(popSize, 2);
        if fitness(candidates(1)) < fitness(candidates(2))
            parent1 = population(candidates(1), :);
        else
            parent1 = population(candidates(2), :);
        end
        
        candidates = randperm(popSize, 2);
        if fitness(candidates(1)) < fitness(candidates(2))
            parent2 = population(candidates(1), :);
        else
            parent2 = population(candidates(2), :);
        end
        
        % –ö—Ä–æ—Å—Å–∏–Ω–≥–æ–≤–µ—Ä (–°–º–µ—à–∏–≤–∞–Ω–∏–µ)
        if rand < crossoverRate
            alpha = rand;
            child = alpha * parent1 + (1 - alpha) * parent2;
        else
            child = parent1;
        end
        
        % –ú—É—Ç–∞—Ü–∏—è (–ì–∞—É—Å—Å–æ–≤—Å–∫–∞—è)
        for j = 1:nDim
            if rand < mutationRate
                sigma = (ub(j) - lb(j)) / 20;
                child(j) = child(j) + sigma * randn;
            end
        end
        child = max(min(child, ub), lb); % –ü—Ä–∏–º–µ–Ω–µ–Ω–∏–µ –≥—Ä–∞–Ω–∏—Ü
        newPopulation = [newPopulation; child];
    end
    population = newPopulation;
    
    % 5. –û–ü–¢–ò–ú–ò–ó–ò–†–û–í–ê–ù–ù–û–ï –û–ë–ù–û–í–õ–ï–ù–ò–ï –í–ò–ó–£–ê–õ–ò–ó–ê–¶–ò–ò
    currentTime = toc(lastUpdateTime);
    shouldUpdate = mod(gen, visualizationUpdateRate) == 0 || ...
                  currentTime >= minDeltaTime || ...
                  gen == 1 || gen == maxGen || ...
                  stallCounter >= maxStallGens;
    
    if shouldUpdate && ~strcmp(visualizationMode, 'none')
        try
            % –û–±–Ω–æ–≤–ª–µ–Ω–∏–µ 2D –≥—Ä–∞—Ñ–∏–∫–∞
            set(h_pop, 'XData', population(:,1), 'YData', population(:,2)); %[output:4fc9abc3]
            set(h_best, 'XData', bestIndividualHistory(gen, 1), 'YData', bestIndividualHistory(gen, 2));
            
            % –û–±–Ω–æ–≤–ª–µ–Ω–∏–µ –ø—É—Ç–∏ –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏
            if gen > 1
                pathX = [get(h_path, 'XData'), bestIndividualHistory(gen, 1)];
                pathY = [get(h_path, 'YData'), bestIndividualHistory(gen, 2)];
                set(h_path, 'XData', pathX, 'YData', pathY);
            end
            
            set(figAnimation, 'Name', sprintf('–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è –ì–ê 2D: –ü–æ–∫–æ–ª–µ–Ω–∏–µ %d | –õ—É—á—à–∞—è –ø—Ä–∏—Å–ø–æ—Å–æ–±–ª–µ–Ω–Ω–æ—Å—Ç—å: %.4f', gen, bestFitnessHistory(gen)));
            
            % –û–±–Ω–æ–≤–ª–µ–Ω–∏–µ 3D –≥—Ä–∞—Ñ–∏–∫–∞ –µ—Å–ª–∏ –≤–∫–ª—é—á–µ–Ω–æ
            if strcmp(visualizationMode, 'full')
                zPop = arrayfun(@(i) goldstein_price(population(i,:)), 1:popSize);
                bestZ = goldstein_price(bestIndividualHistory(gen, :));
                
                set(h_pop3D, 'XData', population(:,1), 'YData', population(:,2), 'ZData', zPop); %[output:0d3c0f47]
                set(h_best3D, 'XData', bestIndividualHistory(gen, 1), 'YData', bestIndividualHistory(gen, 2), 'ZData', bestZ);
                
                % –û–±–Ω–æ–≤–ª–µ–Ω–∏–µ 3D –ø—É—Ç–∏ –æ–ø—Ç–∏–º–∏–∑–∞—Ü–∏–∏
                if gen > 1
                    pathX3D = [get(h_path3D, 'XData'), bestIndividualHistory(gen, 1)];
                    pathY3D = [get(h_path3D, 'YData'), bestIndividualHistory(gen, 2)];
                    pathZ3D = [get(h_path3D, 'ZData'), bestZ];
                    set(h_path3D, 'XData', pathX3D, 'YData', pathY3D, 'ZData', pathZ3D);
                end
                
                set(fig3D, 'Name', sprintf('–û–ø—Ç–∏–º–∏–∑–∞—Ü–∏—è –ì–ê 3D: –ü–æ–∫–æ–ª–µ–Ω–∏–µ %d | –õ—É—á—à–∞—è –ø—Ä–∏—Å–ø–æ—Å–æ–±–ª–µ–Ω–Ω–æ—Å—Ç—å: %.4f', gen, bestFitnessHistory(gen)));
            end
            
            % –≠—Ñ—Ñ–µ–∫—Ç–∏–≤–Ω–æ–µ –æ–±–Ω–æ–≤–ª–µ–Ω–∏–µ –æ—Ç–æ–±—Ä–∞–∂–µ–Ω–∏—è
            drawnow limitrate nocallbacks
            pause(pauseDuration);
            
            lastUpdateTime = tic; % –°–±—Ä–æ—Å —Ç–∞–π–º–µ—Ä–∞
            fprintf('–ü–æ–∫–æ–ª–µ–Ω–∏–µ %d: –õ—É—á—à–∞—è –ø—Ä–∏—Å–ø–æ—Å–æ–±–ª–µ–Ω–Ω–æ—Å—Ç—å = %.6f\n', gen, bestFitnessHistory(gen)); %[output:0ba2e059]
            
        catch ME
            fprintf('–û–±–Ω–æ–≤–ª–µ–Ω–∏–µ –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–∏ –ø—Ä–æ–ø—É—â–µ–Ω–æ –Ω–∞ –ø–æ–∫–æ–ª–µ–Ω–∏–∏ %d –∏–∑-–∑–∞ –æ—à–∏–±–∫–∏: %s\n', gen, ME.message);
            % –ü—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–µ –ø—Ä–æ–¥–æ–ª–∂–∏—Ç—å –±–µ–∑ –≤–∏–∑—É–∞–ª–∏–∑–∞—Ü–∏–∏
            if contains(ME.message, 'scene') || contains(ME.message, 'rendering')
